function Characteristic(props) {
    return (
        <div>
            <div className='singleCharacteristic'>
                <p><span className='characteristicsName'>{characteristics[props.skillNo]}:</span><br/><span className='characteristicsValue'>{characteristicsValues[props.skillNo]}</span><br /><span className='characteristicsAdvToken'>{characteristicsAdvToken[props.skillNo]}</span></p>
            </div>
        </div>
    )
}

